ob::Client *ob_Screen_client(ob::Screen *self,int i){
    if (i >= (int)self->clients.size())
      return NULL;
    ob::Client::List::iterator it = self->clients.begin();
    std::advance(it,i);
    return *it;
  }
int ob_Screen_clientCount(ob::Screen const *self){
    return (int) self->clients.size();
  }
